import React from 'react';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>Admin Dashboard</h1>
      <p>Welcome to the admin dashboard. Use the navigation links to manage users and payments.</p>
    </div>
  );
};

export default Dashboard;
